Week 2 of #funplaywithchinese x #mandarinagainstallodds : 听说唱.
.
👂🏼 听 - I first learnt about language explosion while studying play therapy. I never really appreciated this until I witnessed the milestone in my children. It has been truly magical watching the little ones banking so many new words daily. Cutest moment? A 20-month old 👧🏻 saying “(sumi)masen” every single time she exit the lift while we toured Tokyo.
.
🗣 说 - We started our Chinese language journey late (when 👧🏻 turned 3) but the immersion in listening to several languages and Chinese dialects since infancy made speaking Chinese a lil more intuitive. The immersion of 听in this sensitive period helped the 说. 👧🏻 converses with me in Mandarin voluntarily now. And just yesterday, the cheeky one randomly said “妈妈，’very good’ 是《很棒》!” And when something tastes good? She goes, “Ho Chiak!”
.
🎶 唱 - Carpool karaoke, everyday! Never mind the off-key singing or 咬字不准, we just want to preserve the fun to make this journey joyful.
.
—-
🥨 Mural paintings discovered during our short walk around Tiong Bahru on Friday. Such charming depictions of our multicultural, multilingual community in Singapore 🇸🇬- a fabric of people so diverse, yet so similar.
.
💕 Holding on to this beautiful heritage so dearly, and hoping that our children will also be fluent in the languages we speak.
.
🌿 Do you have a story to share? I’m really keen to hear it - please share them with me in the comments below or via dm.
.
Thank you @mystorytreasury for initiating such a wonderful project. I’m honoured to be part of it. 🥰 Join us as we reflect on our journey:
